import React from "react";

export default function Time(props) {
  console.log(props.date);
  let days = ["Sunday", "Monday", "Tuesday", "Wedn"]
  let day = props.date.getDay();
  let hour = props.date.getHours();
  let minute = props.date.getMinutes();

  return (
    <div className="time">
      <h4>{day}</h4>
      <h4>
        {hour}:{minute}
      </h4>
    </div>
  );
}
